// Buat peta pencarian case-insensitive
const NORMALIZED_DATABASE = Object.keys(HERO_DATABASE).reduce((acc, key) => {
  acc[key.toLowerCase()] = HERO_DATABASE[key];
  return acc;
}, {} as Record<string, string>);

export const getHeroImage = (heroName: string): string => {
  if (!heroName) return '';
  const name = heroName.trim().toLowerCase();
  return NORMALIZED_DATABASE[name] || '';
};
